import React from "react";
import { NavWhiteCompact } from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import { ScrollNavFunction } from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import DesignTips from "../generalLayout/designTips";
import { FooterGe } from "../generalLayout/footer_test";
import Motor3d from "../generalLayout/motor3d";
import MotorPageHeader from "../generalLayout/motorPageHeader";
import MotorProperties from "../generalLayout/motorProperties";
import MvEmail from "../generalLayout/mvEmail";
import MvEngineMotor from "../generalLayout/mvEngineMotor";
import Nav from "../generalLayout/nav";
import NavDesktop from "../generalLayout/navDesk";
import PageName from "../generalLayout/pageName";

const heroGradientStart = "#777777";
const heroGradientEnd = "#161616";
const dragster800rr_scs_infor = {
  namePage: "Dragster 800 RR SCS",
  price: "20.000",
  nameHeaderTitle: "dragster800rrscs/dragster-rr-scs.svg",
  bgHeaderParallax: "dragster800rrscs/dragster-rr-scs-xl.png",
  manifesto_Arr: ["THE", "SMART", "REBEL"],
  colorBg: `linear-gradient(90deg,${heroGradientStart} 0%,${heroGradientEnd} 100%)`,
  contentHeaderContent:
    "Exuberance and character. Ready to burn the tarmac without breaking a sweat, thanks to the new smart electronic gearbox.",
  Model3ds: [
    {
      link: "dragster800rrscs/original/dragster800rr_scs",
      color:
        "linear-gradient(45deg, rgba(0,0,0,1) 24%, rgba(0,0,0,1) 25%, rgba(56,56,56,1) 55%, rgba(148,148,148,1) 100%)",
      nameOfColor: "MATT MAGNUM AVIO GREY MATT METALLIC DARK GREY",
    },
  ],
  properties: {
    cylinders: 3,
    hp: 140,
    engineMaxAt: "12.300",
    topSpeed: ">240",
    cc: 798,
    kg: "168",
    ratio: "13.3:1",
    scr: {
      large: "dragster800rrscs/properties.jpg",
      medium: "dragster800rrscs/properties-m.jpg",
      small: "dragster800rrscs/properties-s.jpg",
    },
  },
  designTips: {
    span: "DESIGN.",
    strong: " INSTANT CLASSIC",
    p:
      "Inimitable, with a unique personality. The curves of the fuel tank and headlight, the bobbed tail and the elegant spoke wheels superbly frame the three-cylinder engine at the heart of the Dragster. Ready for action, bursting with exuberance and power.",
    src: "dragster800rrscs/design.png",
  },
  engineInf: {
    title: {
      top: "FEEL",
      bottom: "THE POWER OF SOUND",
    },
    src: "dragster800rrscs/engine.png",
    content:
      "Always ready to react to the slightest pressure on the throttle, the 140 HP and 87 Nm three-cylinder engine on the Dragster RR SCS can count on electronic management that’s constantly evolving. The extremely sensitive response is combined with an advanced Smart Clutch System to allow this sophisticated engine to reach its full potential.",
  },
  advantages: [
    {
      name: "Electronic",
      title: "Traction control for lighting launches",
      img: {
        original: "dragster800rrscs/items/electronics.jpg",
        large: "dragster800rrscs/items/electronics-l.jpg",
        medium: "dragster800rrscs/items/electronics-m.jpg",
        small: "dragster800rrscs/items/electronics-s.jpg",
      },
      description:
        "The evolution of the electronics compartment aims at making the Rush 1000 the easiest possible to drive despite its exceptional performance. Thus the extreme care in fine-tuning the electronic management of the engine. The 8-level traction control is particularly useful on a model boasting rocket-like starts, as is the anti-wheelie system and the EAS 2.1 Up & Down for clutch-free changes.",
    },
    {
      name: "Technology",
      title: "Brutal Inspiration",
      img: {
        original: "dragster800rrscs/items/technology.jpg",
        large: "dragster800rrscs/items/technology-l.jpg",
        medium: "dragster800rrscs/items/technology-m.jpg",
        small: "dragster800rrscs/items/technology-s.jpg",
      },
      description:
        'All MV Agusta technology is concentrated in this Rush 1000, which boasts the engine, transmission and chassis of the extremely powerful Brutale 1000 RR. Every technical detail has been adapted to the irreverent vocation of this "strip" bike, to obtain an even more exciting performance. Starting with titanium connecting rods, which reduce engine loads and inertia.',
    },
    {
      name: "Safety",
      title: "Safety",
      img: {
        original: "dragster800rrscs/items/safety.jpg",
        large: "dragster800rrscs/items/safety-l.jpg",
        medium: "dragster800rrscs/items/safety-m.jpg",
        small: "dragster800rrscs/items/safety-s.jpg",
      },
      description:
        "Brembo Stylema callipers linked to Bosch 9 Plus Race ABS with RLM (Rear wheel Lift Mitigation) constitute the ideal combination to manage the exuberance of the Rush 1000. Born to impress, it exploits the electronically adjustable Öhlins EC suspension units to further enhance driving control.",
    },
  ],
};
export default function Dragster800RR_SCS() {
  window.addEventListener("scroll", () => {
    ScrollNavFunction();
    NavWhiteCompact();
  });
  return (
    <>
      <div
        className="nav-pc-homepage"
        style={{ background: dragster800rr_scs_infor.colorBg }}
      ></div>
      <NavDesktop />
      <Nav color="white" />
      <PageName namePage={dragster800rr_scs_infor.namePage} />
      <MotorPageHeader
        manifesto_Arr={dragster800rr_scs_infor.manifesto_Arr}
        nameHeaderTitle={dragster800rr_scs_infor.nameHeaderTitle}
        colorBg={dragster800rr_scs_infor.colorBg}
        contentHeaderContent={dragster800rr_scs_infor.contentHeaderContent}
        price={dragster800rr_scs_infor.price}
        bgHeaderParallax={dragster800rr_scs_infor.bgHeaderParallax}
        reveredContent={false}
        heightContentTop="20%"
        titleSize="auto 21%"
      />
      <Motor3d models={dragster800rr_scs_infor.Model3ds} />
      <MotorProperties properties={dragster800rr_scs_infor.properties} />
      <DesignTips designTips={dragster800rr_scs_infor.designTips} />
      <MvEngineMotor engineInf={dragster800rr_scs_infor.engineInf} />
      <MvEmail />
      <br />
      <FooterGe />
    </>
  );
}
